Events of Default
Each of the following events are defined in the Indentures as an “event of default” (whatever the reason for such event of default and whether or not it
will be voluntary or involuntary or be effected by operation of law or pursuant to any judgment, decree or order of any court or any order, rule or regulation of anyadministrative or governmental body) with respect to the debt securities of any series:
(1)    default in the payment of any installment of interest on any debt securities of such series for 30 days after becoming due;
(2)    default in the payment of principal of or premium, if any, on any debt securities of such series when it becomes due and payable at its statedmaturity, upon optional redemption, upon declaration or otherwise;
(3)    default in the performance, or breach, of any covenant or agreement of ours in the applicable Indenture with respect to the debt securities of suchseries (other than a covenant or agreement, a default in the performance of which or a breach of which is elsewhere in the applicable Indenture
specifically dealt with or that has expressly been included in the applicable Indenture solely for the benefit of a series of debt securities other thansuch series), which continues for a period of 90 days after written notice to us by the trustee or to us and the trustee by the holders of, in the caseof the 2013 Indenture, at least 25% in aggregate principal amount of the outstanding debt securities of that series, and in the case of the 2018
Indenture, at least 33% in aggregate principal amount of the outstanding debt securities of that series;
(4)    we, pursuant to or within the meaning of the Bankruptcy Law:
• commence a voluntary case or proceeding;
• consent to the entry of an order for relief against us in an involuntary case or proceeding;
• consent to the appointment of a custodian of us or for all or substantially all of our property;
• make a general assignment for the benefit of our creditors;
• file a petition in bankruptcy or answer or consent seeking reorganization or relief;
• consent to the filing of such petition or the appointment of or taking possession by a custodian; or
• take any comparable action under any foreign laws relating to insolvency;
(5)    a court of competent jurisdiction enters an order or decree under any Bankruptcy Law that:
• is for relief against us in an involuntary case, or adjudicates us insolvent or bankrupt;
• appoints a custodian of us or for all or substantially all of our property; or
• orders the winding-up or liquidation of us (or any similar relief is granted under any foreign laws);
and the order or decree remains unstayed and in effect for 90 days (or, in the case of the 2018 Indenture, 90 consecutive days); or
(6)    any other event of default provided with respect to debt securities of such series occurs.
“Bankruptcy Law” means Title 11, United States Code or any similar federal or state or foreign law for the relief of debtors. “Custodian” means anycustodian, receiver, trustee, assignee, liquidator or other similar official under any Bankruptcy Law.
