outstanding Notes of a series may, on behalf of the holders of all Notes of that series, waive any past default and its consequences under the applicableIndenture with respect to the Notes of that series, except a default (1) in the payment of principal or premium, if any, or interest on Notes of that series or (2) in
respect of a covenant or provision of the applicable Indenture that cannot be modified or amended without the consent of the holder of each Note of that series.Upon any such waiver, such default will cease to exist, and any event of default arising therefrom will be deemed to have been cured, for every purpose of theIndenture; however, no such waiver will extend to any subsequent or other default or event of default or impair any rights consequent thereon.
